import {Component} from "react";

export class Login extends Component {
    render() {
        return (
            <div className="flex h-screen bg-[#444544]">
                <div className="h-auto mt-4 mb-4 pl-9 mx-auto border-gray-400 border-[0.5px]"></div>
                <form className="h-auto p-2 justify-center bg-white"></form>
            </div>
        );
    }
}
